import React from "react";
import { useDispatch, useSelector } from "react-redux";
import { Link, useParams } from "react-router-dom";

const Career = () => {
  const actorData = useSelector((state) => state.actors.actorCredit.data);

  return (
    <div>
      <div>
        <span>Acting</span>
      </div>
      <div>
        <span>Year</span>
        <span>Movie / Tv Show</span>
        <span>Role</span>
      </div>
      <table>
        <tbody>
          {actorData.cast?.map((item, index) => {
            return (
              <tr key={index}>
                <td className="border-r w-[15%]">
                  {item.release_date && item.release_date
                    ? item.release_date.split("-")[0]
                    : "-"}
                </td>
                <Link to={`/movie/${item.id}`}>
                  <td className="border-r w-[50%]">{item.title}</td>
                </Link>
                <td className="w-[25%]">{item.character}</td>
              </tr>
            );
          })}
        </tbody>
      </table>
    </div>
  );
};

export default Career;
